import React from 'react';
import { ThemeProvider, createTheme  } from '@mui/material/styles'
import Typography from '@mui/material/Typography';
import { makeStyles } from '@mui/styles';
import TitlePartChoice from './titleDifferentPart'
import TextField from '@mui/material/TextField';
import Autocomplete from '@mui/material/Autocomplete';

const useStyles = makeStyles({
    h1: {
        color: "#757575",
        fontSize: "2em",
        fontFamily: "Alegreya Sans SC",
        textAlign: "center",
        marginTop: "2em"
    },
    iconStyleFacebook: {
      color: 'white',
      marginBottom: '3vh',
      marginTop: "1em"
    },
    iconStyleInstagram: {
      color: 'white',
      marginBottom: '3vh'
    },
})
const themeContacts = createTheme({
    typography: {
      h6: {
        marginTop: "3em",
        textAlign: 'center'
      }
    },
})

const testList = [
    { label : "lol", id:1 },
    { label : 'prout', id:2},
 ];

const ContactsMui = () => {
    const classes = useStyles();
    return (
          <ThemeProvider theme={themeContacts}>
                  <TitlePartChoice title="Test"/>
                          <Typography variant='h6'>      
                                Ici c'est juste une page test
                                <Autocomplete
                                disablePortal
                                id="testAutocomplete"
                                option={testList}
                                sx={{ width: 200}}
                                renderInput={(params) => <TextField {...params} label="List"/>}
                                />
                            </Typography>
            </ThemeProvider>
    );
}

export default ContactsMui
